import{_ as s,j as e,k as c,a5 as i}from"./chunks/framework.3Z9w-w8R.js";const k=JSON.parse('{"title":"文件类型","description":"Minecraft支持的文件类型。","frontmatter":{"title":"文件类型","description":"Minecraft支持的文件类型。","mentions":["Ciosciaa","SirLich"]},"headers":[{"level":2,"title":"关卡","slug":"关卡","link":"#关卡","children":[{"level":3,"title":"世界","slug":"世界","link":"#世界","children":[]},{"level":3,"title":"项目","slug":"项目","link":"#项目","children":[]}]},{"level":2,"title":"资源","slug":"资源","link":"#资源","children":[{"level":3,"title":"包","slug":"包","link":"#包","children":[{"level":4,"title":"行为包","slug":"行为包","link":"#行为包","children":[]},{"level":4,"title":"资源包","slug":"资源包","link":"#资源包","children":[]},{"level":4,"title":"皮肤包","slug":"皮肤包","link":"#皮肤包","children":[]}]},{"level":3,"title":"世界模板","slug":"世界模板","link":"#世界模板","children":[]}]},{"level":2,"title":"复合包","slug":"复合包","link":"#复合包","children":[{"level":3,"title":"附加包","slug":"附加包","link":"#附加包","children":[]},{"level":3,"title":"编辑器附加包","slug":"编辑器附加包","link":"#编辑器附加包","children":[]}]}],"relativePath":"documentation/file-types.md","filePath":"documentation/file-types.md"}'),o={name:"documentation/file-types.md"};function l(n,a,p,d,t,r){return c(),e("div",null,a[0]||(a[0]=[i('<p>存在多种文件类型用于_Minecraft_，全部用于导入内容。所有_Minecraft_文件都是ZIP压缩包，重命名为使用<code class="shiki"><span>mc…</span></code>扩展名。这些压缩包目前可分为三类：</p><ul><li><strong>关卡（<code class="shiki"><span>mcworld</span></code>和<code class="shiki"><span>mcproject</span></code>）</strong>：用于世界和项目的关卡数据及相关资源</li><li><strong>资源（<code class="shiki"><span>mcpack</span></code>和<code class="shiki"><span>mctemplate</span></code>）</strong>：用于世界的装饰或辅助资源</li><li><strong>复合包（<code class="shiki"><span>mcaddon</span></code>和<code class="shiki"><span>mceditoraddon</span></code>）</strong>：用于导入最多一个世界或项目以及任意数量的资源类型</li></ul><p>Minecraft的所有文件类型都可以作为任何文件打开，启动Minecraft并导入内容。导入包时，它们会自动解压为其组成文件和目录。如果尚未打开，大多数文件类型将以普通模式启动Minecraft；<code class="shiki"><span>mcproject</span></code>和<code class="shiki"><span>mceditoraddon</span></code>将改为在编辑器模式下启动Minecraft。</p><h2 id="关卡" tabindex="-1">关卡 <a class="header-anchor" href="#关卡" aria-label="Permalink to &quot;关卡&quot;">​</a></h2><p>关卡代表常规世界和编辑器项目的存档数据和资源。所有关卡，无论模式如何，都会被导入到<code class="shiki"><span>com.mojang</span></code>目录中的<code class="shiki"><span>minecraftWorlds</span></code>。</p><p>导入现有已保存关卡的完全重复副本将创建一个重复的已保存关卡。复合压缩包仅在包含多个关卡时导入其中一个，包括跨嵌套复合压缩包的关卡。</p><h3 id="世界" tabindex="-1">世界 <a class="header-anchor" href="#世界" aria-label="Permalink to &quot;世界&quot;">​</a></h3><p><code class="shiki"><span>mcworld</span></code> 封装单个世界的压缩包</p><p>世界压缩包可以通过几种不同的方式创建：</p><ul><li>压缩世界目录的_内容_并将扩展名从<code class="shiki"><span>zip</span></code>重命名为<code class="shiki"><span>mcworld</span></code></li><li>在世界的&quot;游戏设置&quot;屏幕上使用&quot;导出世界&quot;按钮</li><li>在编辑器模式下，从文件→导出为→可玩世界菜单选项导出世界。世界将保存到<code class="shiki"><span>com.mojang</span></code>文件夹中的<code class="shiki"><span>projectbackups</span></code>目录。</li><li>在编辑器模式下，运行<code class="shiki"><span>/project export world</span></code>命令。世界将保存到<code class="shiki"><span>com.mojang</span></code>文件夹中的<code class="shiki"><span>projectbackups</span></code>目录。</li></ul><p>在_Minecraft_以编辑器模式启动时导入世界包会将世界作为项目导入。导入的世界随后在编辑器模式之外将不可访问，需要重新导出为世界以供游玩。在世界压缩包中捆绑的编辑器扩展包在编辑器模式之外导入时将保留。</p><h3 id="项目" tabindex="-1">项目 <a class="header-anchor" href="#项目" aria-label="Permalink to &quot;项目&quot;">​</a></h3><p><code class="shiki"><span>mcproject</span></code> 封装单个编辑器项目的压缩包</p><p>项目压缩包可以通过两种不同的方式创建：</p><ul><li>压缩项目目录的_内容_并将扩展名从<code class="shiki"><span>zip</span></code>重命名为<code class="shiki"><span>mcproject</span></code>。</li><li>在世界的&quot;游戏设置&quot;屏幕上使用&quot;导出项目&quot;按钮</li><li>在编辑器模式下，运行<code class="shiki"><span>/project export project</span></code>命令。世界将保存到<code class="shiki"><span>com.mojang</span></code>文件夹中的<code class="shiki"><span>projectbackups</span></code>目录。</li></ul><p>如果_Minecraft_未打开，启动<code class="shiki"><span>mcproject</span></code>文件将打开编辑器模式。如果_Minecraft_已打开但不在编辑器模式下，则导入<code class="shiki"><span>mcproject</span></code>将失败。</p><h2 id="资源" tabindex="-1">资源 <a class="header-anchor" href="#资源" aria-label="Permalink to &quot;资源&quot;">​</a></h2><p>资源压缩包表示多个非关卡内容的单一实例：</p><ul><li>行为包</li><li>资源包</li><li>皮肤包</li><li>世界模板</li></ul><p>所有资源压缩包都包含一个描述其内容的清单。如果资源压缩包的清单UUID和版本与同一类型的现有资源压缩包完全匹配，则会导入失败。请注意，行为包和资源包共享相同的UUID/版本空间。包含在世界、项目或模板中的自包含行为包和资源包在导入时不计算为重复项。</p><p>两种资源扩展名<code class="shiki"><span>mcpack</span></code>和<code class="shiki"><span>mctemplate</span></code>在功能上表现相同。最佳做法是为行为包、资源包和皮肤包使用<code class="shiki"><span>mcpack</span></code>，为世界模板使用<code class="shiki"><span>mctemplate</span></code>，以便更清楚地了解正在安装的内容。复合压缩包中可以包含任意数量的资源压缩包。</p><h3 id="包" tabindex="-1">包 <a class="header-anchor" href="#包" aria-label="Permalink to &quot;包&quot;">​</a></h3><p><code class="shiki"><span>mcpack</span></code> 代表单个行为包、资源包、皮肤包或世界模板的包。建议仅对世界模板使用<code class="shiki"><span>mctemplate</span></code>，而不是行为包、资源包或皮肤包。</p><p>包只能手动创建，通过压缩行为包、资源包或皮肤包目录的内容并将扩展名从<code class="shiki"><span>zip</span></code>重命名为<code class="shiki"><span>mcpack</span></code>。行为包和资源包是全局安装的，不会与安装在世界、项目或模板中的匹配行为包或资源包冲突。</p><h4 id="行为包" tabindex="-1">行为包 <a class="header-anchor" href="#行为包" aria-label="Permalink to &quot;行为包&quot;">​</a></h4><p>行为包附加到服务器以更改或扩展游戏玩法。行为包安装到<code class="shiki"><span>com.mojang</span></code>文件夹中的<code class="shiki"><span>behavior_packs</span></code>目录。</p><p>开发行为包必须手动放置在<code class="shiki"><span>com.mojang</span></code>下的<code class="shiki"><span>development_behavior_packs</span></code>目录中。</p><h4 id="资源包" tabindex="-1">资源包 <a class="header-anchor" href="#资源包" aria-label="Permalink to &quot;资源包&quot;">​</a></h4><p>资源包附加到客户端以影响声音、视觉效果等。资源包安装到<code class="shiki"><span>com.mojang</span></code>文件夹中的<code class="shiki"><span>resource_packs</span></code>目录。</p><p>开发资源包必须手动放置在<code class="shiki"><span>com.mojang</span></code>下的<code class="shiki"><span>development_resource_packs</span></code>目录中。</p><h4 id="皮肤包" tabindex="-1">皮肤包 <a class="header-anchor" href="#皮肤包" aria-label="Permalink to &quot;皮肤包&quot;">​</a></h4><p>皮肤包是仅限客户端的自定义皮肤包。皮肤包安装到<code class="shiki"><span>com.mojang</span></code>文件夹中的<code class="shiki"><span>skin_packs</span></code>目录。</p><p>开发皮肤包必须手动放置在<code class="shiki"><span>com.mojang</span></code>下的<code class="shiki"><span>development_skin_packs</span></code>目录中，但此功能似乎不起作用。</p><h3 id="世界模板" tabindex="-1">世界模板 <a class="header-anchor" href="#世界模板" aria-label="Permalink to &quot;世界模板&quot;">​</a></h3><p><code class="shiki"><span>mctemplate</span></code> 代表单个行为包、资源包、皮肤包或世界模板的包。建议仅对世界模板使用<code class="shiki"><span>mctemplate</span></code>。</p><p>世界模板安装到<code class="shiki"><span>com.mojang</span></code>下的<code class="shiki"><span>world_templates</span></code>目录。世界模板可以通过几种不同的方式构建：</p><ul><li>压缩世界目录的_内容_，添加世界模板清单，并将扩展名从<code class="shiki"><span>zip</span></code>重命名为<code class="shiki"><span>mctemplate</span></code></li><li>在编辑器模式下，在世界的&quot;游戏设置&quot;屏幕上使用&quot;导出模板&quot;按钮</li><li>在编辑器模式下，运行<code class="shiki"><span>/project export template</span></code>命令。世界将保存到<code class="shiki"><span>com.mojang</span></code>文件夹中的<code class="shiki"><span>projectbackups</span></code>目录。</li></ul><h2 id="复合包" tabindex="-1">复合包 <a class="header-anchor" href="#复合包" aria-label="Permalink to &quot;复合包&quot;">​</a></h2><p>复合压缩包用于在单次导入操作中导入最多_一个_关卡压缩包以及任意数量或组合的资源压缩包。通常，复合包的内容必须被打包。也可以在复合压缩包的_顶层_提供目录，以便在不需要预先打包的情况下导入资产类型（行为包、资源包、皮肤包和世界模板）。组织用途的嵌套子目录不能使用。</p><p>复合内容按常规处理。例如，在编辑器模式下导入包含<code class="shiki"><span>mcworld</span></code>的<code class="shiki"><span>mcaddon</span></code>时，会将世界作为项目导入。</p><p>复合压缩包还可以包含任意数量或嵌套的其他复合压缩包，即使跨越_Minecraft_模式也是如此。嵌套复合压缩包不能用于绕过单个世界导入限制。</p><p>复合包只能通过压缩归档和资产类型手动构建。</p><h3 id="附加包" tabindex="-1">附加包 <a class="header-anchor" href="#附加包" aria-label="Permalink to &quot;附加包&quot;">​</a></h3><p><code class="shiki"><span>mcaddon</span></code> 通用复合内容压缩包</p><p>在_Minecraft_以编辑器模式启动时导入<code class="shiki"><span>mcaddon</span></code>包会将任何包含的世界作为项目导入。导入的世界随后在编辑器模式之外将不可访问，需要重新导出为世界以供游玩。资产类型按常规导入。</p><h3 id="编辑器附加包" tabindex="-1">编辑器附加包 <a class="header-anchor" href="#编辑器附加包" aria-label="Permalink to &quot;编辑器附加包&quot;">​</a></h3><p><code class="shiki"><span>mceditoraddon</span></code> 用于编辑器模式的复合内容压缩包</p><p>如果_Minecraft_未打开，启动<code class="shiki"><span>mcproject</span></code>文件将打开编辑器模式。如果_Minecraft_已打开但不在编辑器模式下，则导入<code class="shiki"><span>mcproject</span></code>将失败。</p>',48)]))}const m=s(o,[["render",l]]);export{k as __pageData,m as default};
